import { HYDRATE } from "next-redux-wrapper";
import { combineReducers } from "redux";

const initialState = {
    user: {
        isLoggedIn: false,
        user: null,
        signUpData: {},
        loginData: {},
    },
    post: {
        mainPosts: [],
    },
};

const rootReducer = (state = initialState, action) => {
    switch (action.type) {
        case "CHANGE_NICKNAME":
            return {
                ...state,
                name: action.data,
            };
    }
};

export default rootReducer;
